"use strict";

/**
 * An api class to mock making requests to the backend.
 * Also see Api.
 */
class MockApi {
    /**
     * @param {?string} appId The app uuid or null to use the default.
     * @param {number} cpuMetric The cpu metric id.
     * @param {number} memoryMetric The memory metric id.
     */
    constructor(appId, cpuMetric, memoryMetric) {
        this.appId = appId;
        this.cpuMetric = 1;
        this.memoryMetric = 2;
    }

    /**
     * Mocks a request to the backend to fetch all servergroups.
     * @return {Promise.<Array.<ServerGroup>>}
     */
    fetchServerGroups() {
        return new Promise(resolve => {
            resolve(serverGroups.map(data => new ServerGroup(data)));
        });
    }

    /**
     * Mocks a request to the backend to fetch memory and cpu data.
     * @param {*} pods The pod html objects.
     * @return {*}
     */
    fetchPodData(pods) {
        return new Promise(resolve => {
            let json = [];
            pods.forEach(pod => {
                json.push({
                    "m": this.cpuMetric,
                    "s": `[${pod.data.short}]`,
                    "viewtype": "MAX",
                    "sA": null,
                    "ds": [],
                    "calc": [Math.sqrt(pod.data.id % 50) + Math.random()]
                });
                json.push({
                    "m": this.memoryMetric,
                    "s": `[${pod.data.short}]`,
                    "viewtype": "MAX",
                    "sA": null,
                    "ds": [],
                    "calc": [pod.data.id % 50 + 45 + Math.random()]
                });
            });

            resolve(json);
        });
    }
}

